       "id": "c7034df3-eb7b-4cad-a323-3f5c6ceb9283",
       "title": "illo est ratione doloremque quia maiores aut",
       "completed": true
    }
 ])


    return (
        <SApp>
         
            <SHeader>
            <h2>Todo List</h2>
            <TodoAdd todos={todos} setTodos={setTodos}/>
